var parcelHelpers = require("@parcel/transformer-js/src/esmodule-helpers.js");
parcelHelpers.defineInteropFlag(exports);
exports.default = {
    inject: [
        "$axios",
        "Craft"
    ],
    props: {},
    data () {
        return {
            activeModal: false,
            modalMode: "single",
            modalEditId: null,
            items: null,
            selectedItems: [],
            totalCount: null,
            sites: [],
            serverParams: {
                page: 1,
                perPage: 50,
                handled: "all",
                site: "all",
                sortBy: "newest"
            }
        };
    },
    computed: {
        selectAll: {
            get: function() {
                return this.items ? this.selectedItems.length == this.items.length : false;
            },
            set: function(value) {
                var selected = [];
                if (value) this.items.forEach(function(item) {
                    selected.push(item.id);
                });
                this.selectedItems = selected;
            }
        }
    },
    watch: {},
    methods: {
        loadItems () {
            this.$axios.post(window.redirectMate.actions.getRedirects, this.serverParams).then(({ data  })=>{
                console.log(data);
                this.totalCount = data.count;
                this.items = data.data;
            }).catch((error)=>{
                console.error(error);
            });
        },
        updateTable () {
            this.loadItems();
        },
        addRedirect () {
            this.modalMode = "single";
            this.modalEditId = null;
            this.activeModal = true;
        },
        closeModal () {
            this.activeModal = false;
            this.loadItems();
        },
        batchDeleteItems () {
            console.log("batchDeleteItems", this.selectedItems);
            this.$axios.post(window.redirectMate.actions.deleteRedirects, {
                ids: this.selectedItems
            }).then(({ data  })=>{
                console.log(data);
                this.selectedItems = [];
                this.loadItems();
            }).catch((error)=>{
                console.error(error);
            });
        },
        editRedirect (id) {
            this.modalMode = "edit";
            this.modalEditId = id;
            this.activeModal = true;
        },
        getSiteName (siteId) {
            if (siteId) {
                const site = this.sites.find(({ id  })=>id === siteId);
                return site ? site.name : "Unknown";
            } else return "All sites";
        }
    },
    mounted () {
        console.log("mounted");
        if (window.redirectMate.sites && window.redirectMate.sites.length > 0) this.sites = window.redirectMate.sites;
        this.loadItems();
        Craft.initUiElements();
    }
};

